import React from 'react';
import * as service from '../services/user-account-service';

class Main extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            users: []
        };
    }


    componentDidMount() {
        const fetchedAccounts = service.fetchAllUserAccount().then(
            () => {
                console.log(fetchedAccounts);
                this.setState({
                    users: fetchedAccounts
                });
            }
        );
    }

    render() {
        const items = this.state.users.map(user => <li>{user}</li>)
        return (
            <div>{items}</div>
        )
    }
}

export default Main;
